import Image from "react-bootstrap/Image"
import {Container, Row, Col} from "react-bootstrap"

const Home = () => {
    return (
        <Container className="homePage">
            <Row>
                <Col>
                    <Image src="bo600.png" roundedCircle="true"/>
                </Col>
                <Col className="bio">
                    <h1>About Me</h1>
                </Col>
            </Row>
        </Container>
    );
};

export default Home;
